insert  into `man_powers`(`id`,`requested_by`,`job_title`,`job_group`,`description`,`responsibilities`,`qualifications`,`benefits`,`vacancies`,`job_nature`,`location`,`expires_at`,`required_experience`,`department`,`active`,`approved_by`,`approved_on`,`created_at`,`updated_at`,`deleted_at`,`quiz_id`) values (1,1,'IT Assistant','IT','The IT Assistant is a key support role within the IT department, contributing to the overall efficiency and effectiveness of an organization\'s IT infrastructure. Strong communication skills, technical proficiency, and a customer-focused mindset are essential for success in this role.','Provide first-line support for hardware, software, and network issues.\r\n\r\nAssist users in troubleshooting problems and resolving technical issues.\r\n\r\nRespond to helpdesk tickets and inquiries in a timely and efficient manner.','A degree in Information Technology, Computer Science, or a related field is  preferred.','Coverage for medical, dental, and vision expenses to help maintain the well-being of the employee.',5,'FULL_TIME','DAVAO','2024-11-12','FRESH','IT_DEPT',1,NULL,NULL,'2023-10-10 14:50:04','2023-11-14 17:15:39',NULL,1),(2,1,'IT Engineer','IT','An IT Engineer plays a crucial role in ensuring the stability, security, and efficiency of an organization\'s IT infrastructure. The specific requirements for the role may vary based on the industry, the complexity of the IT environment, and the organization\'s size.','Responsible for designing, implementing, managing, and maintaining an organization\'s IT infrastructure. The role may involve working with a variety of technologies, including hardware, software, networks, and security systems.','A bachelor\'s degree in Information Technology, Computer Science, or a related field is required.\r\n\r\nProfessional certifications can be beneficial, such as Cisco Certified Network Professional (CCNP), Microsoft Certified: Azure Solutions Architect Expert, Certified Information Systems Security Professional (CISSP), or others depending on the specific technologies used.','Incentives based on individual or team performance, meeting project goals, or achieving milestones.\r\n\r\nComprehensive medical, dental, and vision insurance coverage for the employee and, in some cases, their dependents.',5,'FULL_TIME','NCR','2023-10-10','JUNIOR','IT_DEPT',1,NULL,NULL,'2023-11-01 10:23:47','2023-11-14 17:15:55',NULL,1),(3,1,'Web Developer','IT','Professional who specializes in the development of web applications, websites, and other online solutions. Web developers typically work with programming languages, frameworks, and various technologies to create functional and visually appealing websites.','Responsible for the site\'s technical aspects, such as its performance and capacity, which are measures of a website\'s speed and how much traffic the site can handle. In addition, web developers may create content for the site.','A bachelor\'s degree in Computer Science, Software Engineering, Web Development, or a related field is preferred.','Provision of a budget or allowance for purchasing or upgrading personal technology devices.',5,'PART_TIME','NCR','2024-01-09','JUNIOR','IT_DEPT',1,NULL,NULL,'2023-11-09 05:20:31','2023-11-15 09:37:19',NULL,1),(4,1,'Senior Software Developer','IT','We are currently seeking a highly skilled and motivated individual to join our Information Technology team in the role of Senior Software Developer. As a key member of our IT department, you will be responsible for designing, developing, and implementing software solutions that align with our business requirements. Collaboration with cross-functional teams is crucial in this role, as you analyze and understand project requirements, conduct code reviews, and provide constructive feedback to ensure the delivery of high-quality software solutions.\r\n\r\nThe ideal candidate will possess a Bachelor\'s degree in Computer Science or a related field and have a proven track record as a Software Developer, demonstrating expertise in relevant technologies. Strong problem-solving skills, attention to detail, and excellent communication abilities are essential, along with familiarity with agile development methodologies. In addition to contributing to the success of our projects, you will play a key role in mentoring and guiding junior developers within the team.\r\n\r\nWe offer a competitive salary package, health and dental insurance, flexible work hours, and professional development opportunities in a collaborative and innovative work environment. If you have 3 to 5 years of experience in software development and are ready to take on a challenging and rewarding role, we encourage you to apply. The position is based in the NCR, and the deadline for applications is January 31, 2024. Join us in shaping the future of our Information Technology initiatives.','Design, develop, and implement software solutions to meet business requirements.\r\nCollaborate with cross-functional teams to analyze and understand project requirements.\r\nConduct code reviews and provide constructive feedback to team members.\r\nTroubleshoot, debug, and optimize application code as needed.\r\nStay updated on industry trends and incorporate best practices into development processes.\r\nMentor and guide junior developers in the team.','Bachelor\'s degree in Computer Science or related field.\r\nProven experience as a Software Developer with expertise in [relevant technologies].\r\nStrong problem-solving skills and attention to detail.\r\nExcellent communication and teamwork abilities.\r\nFamiliarity with agile development methodologies.','Competitive salary package.\r\nHealth and dental insurance.\r\nFlexible work hours.\r\nProfessional development opportunities.\r\nCollaborative and innovative work environment.',1,'FULL_TIME','NCR','2024-01-31','MID','IT_DEPT',1,NULL,NULL,'2023-11-17 04:21:40','2023-11-17 04:23:25',NULL,1),(5,1,'Human Resource Assistant','HR','We are currently looking for a dedicated and detail-oriented individual to join our Human Resources team as a Human Resource Assistant. In this role, you will play a crucial part in supporting various HR functions and ensuring the smooth operation of day-to-day activities. Your responsibilities will include assisting in recruitment processes, maintaining employee records, coordinating training programs, and providing administrative support to the HR department.','Support recruitment efforts by posting job openings, reviewing resumes, and coordinating interview schedules.\r\nAssist in onboarding processes, including the preparation of new employee documentation and orientation materials.\r\nMaintain accurate and up-to-date employee records, including personal information, attendance, and performance evaluations.\r\nHandle routine HR inquiries and provide assistance to employees regarding HR policies and procedures.\r\nCoordinate and organize training programs and events for employee development.\r\nAssist in the implementation of HR initiatives and projects.\r\nProvide general administrative support to the HR department.','Bachelor\'s degree in Human Resources, Business Administration, or related field.\r\nStrong organizational and multitasking skills.\r\nExcellent written and verbal communication abilities.\r\nProficient in Microsoft Office Suite.\r\nDemonstrated ability to maintain confidentiality and handle sensitive information.\r\nProactive and positive attitude with a willingness to learn.','Competitive salary package.\r\nHealth and dental insurance.\r\nOpportunities for professional development.\r\nCollaborative and inclusive work environment.',2,'FULL_TIME','NCR','2024-02-15','FRESH','HR_DEPT',1,NULL,NULL,'2023-11-17 04:35:00','2023-11-17 04:35:04',NULL,3),(6,1,'Truck Driver','OPS','As a Truck Driver, you will play a pivotal role in our operations team, ensuring the safe and timely transport of goods.','Safely operate and maintain company vehicles in adherence to all traffic and safety regulations.\r\nExecute pre-trip and post-trip inspections to ensure the roadworthiness of the vehicle.\r\nTransport goods to designated locations in a timely and efficient manner.\r\nCollaborate with logistics and dispatch teams to coordinate delivery schedules.\r\nMaintain accurate records of deliveries, vehicle inspections, and fuel consumption.','Valid commercial driver\'s license (CDL) with a clean driving record.\r\nDemonstrated knowledge of and adherence to traffic laws and safety regulations.\r\nAbility to conduct routine vehicle inspections and address minor mechanical issues.\r\nExcellent time management and organizational skills.\r\nStrong communication skills and the ability to collaborate effectively with team members.','Competitive compensation package.\r\nContract-based employment with the potential for extension.\r\nOpportunities for professional development and training.\r\nSupportive and collaborative work environment.\r\nAccess to company benefits, including health and wellness programs.',3,'CONTRACT','LEGAZPI','2024-01-15','FRESH','OPS_DEPT',1,NULL,NULL,'2023-11-17 04:46:39','2023-11-17 04:46:41',NULL,4);

