insert  into `quiz_questions`(`id`,`quiz_id`,`question`,`choice_a`,`choice_b`,`choice_c`,`choice_d`,`answer`,`created_at`,`updated_at`) values (1,1,'How many bits make a byte?','12','8','16','24','choice_b',NULL,'2023-11-12 21:20:50'),(2,1,'The number of bits used by IPv6 address is?','16','32','64','128','choice_d',NULL,'2023-11-12 21:20:50'),(3,1,'Which technology is used to record cryptocurrency transactions?','Mining','Digital wallet','Blockchain technology','Token','choice_c',NULL,'2023-11-12 21:20:50'),(4,1,'What technology is used to make telephone calls over the Internet possible?','VoIP','Bluetooth','Ethernet','None of the above','choice_a',NULL,'2023-11-12 21:20:50'),(5,1,'What is the full form of (CPU)?','Central Processing Unit','Critical Processing Unit','Crucial Processing Unit','Central Printing Unit','choice_a',NULL,'2023-11-12 21:20:50'),(6,2,'How many revolutions of the crankshaft are in a complete cycle for a 2-stroke-cycle engine?','1','4','12','0','choice_a',NULL,'2023-11-12 22:42:02'),(8,2,'The crankshaft has large lobes that act as counterweights, continuing centrifugal force to keep the crank turning after the explosion of the fuel.','True','False','Maybe','I\'m not sure','choice_a',NULL,NULL),(9,3,'Designation, Location and Job related duties are mentioned in the::','Job Description','Job Evaluation','Recruitment Letter','Curriculum Vitae','choice_a',NULL,NULL),(10,3,'_____________ is a process that aims at rejecting unsuitable candidates.','Job Training','Job Evaluation','Selection','Recruitment','choice_c',NULL,NULL),(11,3,'Which of the Options would best describe External Recruitment. 1.Placement Agencies, 2. Employee Referrals, 3. Job Fairs.  4. Promotions.','1, 2, & 3','2&3','1&3','All of the above','choice_c',NULL,NULL),(12,3,'Placing the right man for the right job is an example of _____________','Job Description','Job Analysis','Job Specification','Job Portfolio','choice_b',NULL,NULL),(13,3,'Job analysis is a process of gathering information about the','Job','Management','Job Holder','Organization','choice_a',NULL,NULL),(14,4,'What factors should you consider when planning a long-haul route?','Only fuel stations','Weather conditions, traffic patterns, and rest areas','Your favorite roadside attractions','The view along the way','choice_b',NULL,NULL),(15,4,'What is the proper way to conduct a pre-trip inspection on your truck?','Skip it; it\'s not necessary','Quickly glance at the tires and engine','Systematically check brakes, lights, tires, and fluids','Have someone else do it for me','choice_c',NULL,NULL),(16,4,'Why is it important to adhere to Hours of Service regulations?','It\'s just a guideline; you can bend the rules','To ensure drivers get enough sleep and prevent fatigue-related accidents','I\'m the king of the road, why does it matter?','They don\'t really matter for experienced drivers','choice_b',NULL,NULL),(17,4,'In the event of a roadside emergency, what should you do first?','Panic and call for help immediately','Attempt to fix the issue on your own without contacting anyone','Run and hide','Assess the situation, ensure your safety, and then call for assistance','choice_d',NULL,NULL),(18,4,'How should you secure cargo for transport?','Use proper restraints and distribute the load evenly','Load it quickly; it\'ll settle during the trip','Just make sure it all fits in, regardless of weight distribution','As long as it fits it\'s good','choice_a',NULL,NULL);

